define('text!views/funds/browse.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <h4 class="view-heading">FUNDS</h4>\r\n\r\n        <div class="row">\r\n            <div class="large-12 columns">\r\n                <a data-bind="click: navigateToCreateView">Create a new fund</a>\r\n            </div>\r\n        </div>\r\n\r\n        <p class="error-message" data-bind="if: error, text: error"></p>\r\n\r\n        <div class="row">\r\n            <div class="large-4 columns">\r\n                <label for="Area">\r\n                    Fund requesting area\r\n                </label>\r\n                <select name="Area" data-bind="foreach: areas, value: selectedAreaId">\r\n                    <option data-bind="attr: { value: Id }, text: Name"></option>\r\n                </select>\r\n            </div>\r\n        </div>\r\n\r\n        <div class="row">\r\n            <div class="large-12 columns">\r\n                <table class="tabular" data-bind="visible: !noItemsToShow()">\r\n                    <thead>\r\n                        <tr>\r\n                            <th data-bind="click: sort.bind($data, \'Number\')">\r\n                                Fund number</th>\r\n                            <th data-bind="click: sort.bind($data, \'Title\')">\r\n                                Fund title</th>\r\n                            <th data-bind="click: sort.bind($data, \'ResponsiblePerson\')">\r\n                                Fund responsible person</th>\r\n                            <th data-bind="click: sort.bind($data, \'CurrentBudget\')">\r\n                                Fund current fiscal year approved budget</th>\r\n                            <th data-bind="click: sort.bind($data, \'ProjectedExpenditures\')">\r\n                                Fund current fiscal year projected expenditures</th>\r\n                            <th data-bind="click: sort.bind($data, \'requestedBudget\')">\r\n                                Fund requested budget</th>\r\n                            <th data-bind="click: sort.bind($data, \'variance\')">\r\n                                Fund variance</th>\r\n                            <th data-bind="click: sort.bind($data, \'Status\')">\r\n                                Fund status</th>\r\n                        </tr>\r\n                    </thead>\r\n                    <tbody data-bind="foreach: items">\r\n                        <tr>\r\n                            <td>\r\n                                <a data-bind="fastlink: \'#/funds/edit/\' + Id, text: Number"></a>\r\n                            </td>\r\n                            <td data-bind="text: Title"></td>\r\n                            <td data-bind="text: ResponsiblePerson"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedCurrentBudget"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedProjectedExpenditures"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedRequestedBudget"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedVariance"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: fundStatusText"></td>\r\n                        </tr>\r\n                    </tbody>\r\n                </table>\r\n            </div>\r\n        </div>\r\n\r\n        <p data-bind="if: noItemsToShow">No records</p>\r\n    </div>\r\n</div>\r\n';});

